'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term3' => 'Услуге се пружају по виђењу.  &amp;vendorShortName;, приложници, даваоци лиценци и дистрибутери одричи све гаранције, било имплицитне или експлицитне, укључујући али се не ограничавајући на гаранције да услуге служе сврси за коју су намењене.  Ви сами сносите целокупан ризик избора услуга које одговарају Вашим потребама и захтевима о квалитету.  У неким јурисдикцијама изузеће или ограничавање имплицитних гаранција није дозвољено, у ком случају ово ограничење одговорности се можда не примењује на Вас.',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term2' => 'Слободни сте да користите услуге које прате ово издање програма &amp;brandShortName;, и имате сва права која су потребна да то и урадите.  &amp;vendorShortName; и даваоци лиценци задржавају сва друга права на услуге.  Ови услови не могу да ограниче Ваша права која вам гарантује лиценца отвореног кода коју примењујемо на програм &amp;brandShortName; и на одговарајући изворни код програма &amp;brandShortName;.',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term5' => '&amp;vendorShortName; може да допуни ове услове по потреби, с времена на време.  Услови се не могу мењати или отказати без писменог одобрења које даје &amp;vendorShortName;.',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term4' => 'Осим у законом прописаним случајевима, &amp;vendorShortName;, приложници, даваоци лиценци и дистрибутери неће бити одговорни ни за какву индиректну, посебну, последичну, случајну, или примерну штету која настане као последица или у било каквој другој вези са употребом програма &amp;brandShortName; и услуга.  Укупна одговорност под овим условима неће премашити $500 (пет стотина америчких долара).  У неким јурисдикцијама изузеће или ограничење вредности обештећења није дозвољено, у ком случају ово ограничење одговорности се можда не примењује на Вас.',
